urce"},{"attributes":{},"id":"1875","type":"UnionRenderers"},{"attributes":{"css_classes":["markdown"],"margin":[5,5,5,5],"name":"CAT","sizing_mode":"stretch_width","text":"&amp;lt;h2&amp;gt;CAT&amp;lt;/h2&amp;gt;\n&amp;lt;p&amp;gt;CAT is designed to identify the species or other taxonomic group of origin for a given DNA sequence, \nbased on the presence or absence of specific genetic markers.&amp;lt;/p&amp;gt;\n&amp;lt;ul&amp;gt;\n&amp;lt;li&amp;gt;CAT uses a database of known genetic markers for different taxonomic groups to create a reference index.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;The DNA sequence to be classified is compared to the reference index using a sequence alignment algorithm, such as BLAST.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;CAT scores each alignment between the amplicon and the reference markers based on how well they match.&amp;lt;/li&amp;gt;\n&amp;lt;li&amp;gt;The taxonomic group with the highest score is considered the most likely origin of the sequence.&amp;lt;/li&amp;gt;\n&amp;lt;/ul&amp;gt;"},"id":"1860","type":"panel.models.markup.HTML"},{"attributes":{},"id":"1839","type":"StringEditor"},{"attributes":{},"id":"1773","type":"StringEditor"},{"attributes":{"editor":{"id":"1839"},"field":"sequence","formatter":{"id":"1838"},"title":"sequence","width":0},"id":"1840","type":"TableColumn"},{"attributes":{},"id":"1772","type":"StringFormatter"},{"attributes":{"data":{"index":[0,1,2,3],"kingdom":["Viruses","Viruses","Viruses","Viruses"],"last_level":[" Human alphaherpesvirus 3"," Human alphaherpesvirus 3"," Human alphaherpesvirus 3"," Human alphaherpesvirus 3"],"name":["k79_0","k79_1","k79_4","k79_3"],"second_level":[" Varicellovirus"," Varicellovirus"," Varicellovirus"," Varicellovirus"],"taxon_id":[10335,10335,10335,10335],"third_level":[" Alphaherpesvirinae"," Alphaherpesvirinae"," Alphaherpesvirinae"," Alphaherpesvirinae"]},"selected":{"id":"1874"},"selection_policy":{"id":"1873"}},"id":"1805","type":"ColumnDataSource"},{"attributes":{"form
